var tipuesearch = {"pages": [{'title': 'About', 'text': '本學期的電腦輔助設計實習, 要求每一位學員根據本 HW template 的格式建立個人的作業倉儲與網頁. \n \n 40923247 \n 網站倉儲:  https://github.com/40923247/cad2021_hw \n 網站連結:\xa0 https://40923247.github.io/cad2021_hw/ \n 其他與作者或作業相關資料說明或介紹 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Task', 'text': '', 'tags': '', 'url': 'Task.html'}, {'title': 'hwpages', 'text': '\n \n \n 40723126 \n \n \n 40723135 \n \n \n 40723217 \n \n \n 40732331 \n \n \n 40823114 \n \n \n 40823115 \n \n \n 40823117 \n \n \n 40823119 \n \n \n 40823122 \n \n \n 40823127 \n \n \n 40823146 \n \n \n 40823148 \n \n \n 40823215 \n \n \n 40871106 \n \n \n 40923201 \n \n \n 40923203 \n \n \n 40923204 \n \n \n 40923205 \n \n \n 40923206 \n \n \n 40923207 \n \n \n 40923208 \n \n \n 40923209 \n \n \n 40923210 \n \n \n 40923211 \n \n \n 40923212 \n \n \n 40923213 \n \n \n 40923214 \n \n \n 40923216 \n \n \n 40923217 \n \n \n 40923218 \n \n \n 40923219 \n \n \n 40923220 \n \n \n 40923221 \n \n \n 40923223 \n \n \n 40923224 \n \n \n 40923225 \n \n \n 40923226 \n \n \n 40923227 \n \n \n 40923228 \n \n \n 40923229 \n \n \n 40923230 \n \n \n 40923231 \n \n \n 40923232 \n \n \n 40923233 \n \n \n 40923234 \n \n \n 40923235 \n \n \n 40923236 \n \n \n 40923237 \n \n \n 40923238 \n \n \n 40923239 \n \n \n 40923240 \n \n \n 40923241 \n \n \n 40923242 \n \n \n 40923243 \n \n \n 40923244 \n \n \n 40923245 \n \n \n 40923246 \n \n \n 40923247 \n \n \n 40923248 \n \n \n 40923249 \n \n \n 40923250 \n \n \n 40923251 \n \n \n 40923252 \n \n \n 40923253 \n \n \n 40971220 \n \n \n 40971227 \n \n \n \n', 'tags': '', 'url': 'hwpages.html'}, {'title': 'githubpages', 'text': '\n 40723126   40723135   40723217   40732331   40823114   40823115   40823117   40823119   40823122   40823127   40823146   40823148   40823215   40871106   40923201   40923203   40923204   40923205   40923206   40923207   40923208   40923209   40923210   40923211   40923212   40923213   40923214   40923216   40923217   40923218   40923219   40923220   40923221   40923223   40923224   40923225   40923226   40923227   40923228   40923229   40923230   40923231   40923232   40923233   40923234   40923235   40923236   40923237   40923238   40923239   40923240   40923241   40923242   40923243   40923244   40923245   40923246   40923247   40923248   40923249   40923250   40923251   40923252   40923253   40971220   40971227 \n \n', 'tags': '', 'url': 'githubpages.html'}, {'title': 'HW1', 'text': 'HW1 佔學期成績 25% \n HW1 必須在 2021.11.10 22:00 之前完成. \n HW1 具體項目成果回報區 將於 2021.09.23 開啟, 於  2021.11.10 22:00 關閉. \n 作業一: meArm Robot 零件繪圖與機電運動模擬場景製作 \n Step1 : 下載  meARM.7z  這個包含尚未完成組立的 meArm Robot 場景與雷射切割零件組立手冊. \n meArm_75-0040_v1.pdf  則是另外一本組立參考手冊. \n Step2 : 從課程網頁中的  Compile CoppeliaSim 頁面 , 下載  coppeliaSim 4.1.0 官方版與 MSYS2 編譯版.7z  (檔案大小 412 MB, 解開壓縮後 1GB) 可攜套件. \n Step3 : 在 HW1 中, 要求每一位學員透過程式亂數分配 (兩班實際亂數分配結果以上課時點擊下列按鈕所得結果為準) 所使用的兩套參數式 CAD 套件, 從軟體發展緣起開始進行介紹,\xa0 經過教育版軟體套件檔案的取得, 下載安裝以及配置使用. 根據 Step1 中的零件尺寸, 逐一完成 meArm Robot 各零件繪製與組立. 並將零件 匯入  CoppeliaSim 進行組裝配置後, 以  UI 介面 中的 slider 控制 meArm Robot 各軸的旋轉作動. \n 2b CAD 套件分配結果:  https://mde.tw/cad2021/downloads/online/2b_hw1_cad.txt \n 附件: \n 1. CAD 套件分配表: \n sw: Solidworks, inv: Inventor, nx: NX12, ons: Onshape, slvs: Solvespace \n 2a 套件亂數分配結果 \n 2b 套件亂數分配結果 \n 2. 在兩套 CAD 完成零件繪圖並轉入 CoppeliaSim 後, 為了建立 Dynamic Model 必須利用  shape edit modes  轉為  clean model , 並與實際轉入的 STL 格式零件外形結合應用後建立模擬場景 (scenes). \n 3. meARM Robot  動態模擬場景 的建構, 可參考  0 ,  1 ,  2 ,  3 ,  4 ,  5 ,  6 ,  7 , 也可參考  Uarm Robot model  與相關 影片 . \n 4. CoppeliaSim design dynamic simulations  說明頁面 . \n 5.  網際 Lua  程式執行. \n 6.  meArm.slvs ,  meArm_in_solvespace.slvs \n 7. UI 介面程式參考: \n function closeEventHandler(h)\n    sim.addLog(sim.verbosity_scriptinfos,\'Window \'..h..\' is closing...\')\n    simUI.hide(h)\nend\n\nfunction joint1_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta1 set to \'..newVal)\n    sim.setJointTargetPosition(joint1, newVal*deg)\nend\n\nfunction joint2_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta2 set to \'..newVal)\n    sim.setJointTargetPosition(joint2, newVal*deg)\nend\n\nfunction joint3_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta3 set to \'..newVal)\n    sim.setJointTargetPosition(joint3, newVal*deg)\nend\n\nfunction joint16_rotate(ui,id,newVal)\n    simUI.setLabelText(ui,3000,\'theta16 set to \'..newVal)\n    sim.setJointTargetPosition(joint16, newVal*deg)\n    sim.setJointTargetPosition(joint20, -newVal*deg)\nend\n\nfunction sysCall_init()\n    -- do some initialization here\n    joint1 = sim.getObjectHandle(\'motor1\')\n    joint2 = sim.getObjectHandle(\'motor2\')\n    joint3 = sim.getObjectHandle(\'motor3\')\n    joint16 = sim.getObjectHandle(\'motor16\')\n    joint20 = sim.getObjectHandle(\'motor20\')\n    i = 0\n    deg = math.pi/180\n    print(i)\n    xml = [[\n<ui closeable="true" on-close="closeEventHandler" resizable="true">\n    <label text="This is a demo of the CustomUI plugin. Browse through the tabs below to explore all the widgets that can be created with the plugin." wordwrap="true" />\n    <tabs>\n        <tab title="Numeric">a\n            <label text="Sliders can be oriented horizontally or vertically, and have optional properties that can be set (in the XML) such as minimum and maximum value." wordwrap="true" />\n            <label text="" id="3000" wordwrap="true" />\n            <label text="theta1" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="360" on-change="joint1_rotate" />\n            <label text="theta2" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="65" on-change="joint2_rotate" />\n            <label text="theta3" /> <hslider tick-position="above" tick-interval="1" \n            minimum="-90" maximum="185" on-change="joint3_rotate" />\n            <label text="theta16" /> <hslider tick-position="above" tick-interval="1" \n            minimum="0" maximum="15" on-change="joint16_rotate" />\n        </tab>\n    </tabs>\n</ui>\n]]\n    ui=simUI.create(xml)\n    \nend \n \n (From:  2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf ) \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'SOLIDWORKS 繪圖', 'text': 'SOLIDWORKS  緣起說明與介紹 \n SolidWorks公司成立於1993年12月，其總部設在美國麻州康克爾郡，西元1995年發表其第一款產品SolidWorks 95，1997年被達梭系統併購，SolidWorks公司現在是達梭系統的子公司。 \n SolidWorks的是產品設計師和機械工程師使用的軟體，全世界其用戶範圍從個人到大公司，涵蓋非常廣泛的橫截面製造業細分市場。商業銷售是通過間接渠道，其中包括遍及世界各地的交易商和合作夥伴，且運行在微軟Windows平台下的3D機械CAD軟體。 \n \n \n', 'tags': '', 'url': 'SOLIDWORKS 繪圖.html'}, {'title': 'SOLIDWORKS\xa0安裝配置', 'text': '\xa0下載安裝與配置流程 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020 下載安裝與配置 」且加上 語音說明 與 字幕. \n 由於安裝配置 Solidworks 時必須使用 nfu 的 vpn, 因此各學員必須按照 說明 , 完成本學期的 vpn 使用申請. \n Solidworks 分別提供 2017 與 2020 版本: \n SW2017 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n SW2020 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n 安裝步驟 \n STEP1.下載SOLIWORKS2020安裝光碟壓縮檔 \n STEP2. 至學校E-CARE申請NFU SSL-VPN連線申請(安裝過程中需要使用) \n STEP3.解壓縮後依照安裝說明及資料夾中記事本的序號進行安裝(安裝影片youtube) \n \n STRP4.完成! \n', 'tags': '', 'url': 'SOLIDWORKS\xa0安裝配置.html'}, {'title': 'SOLIDWORKS 操作流程', 'text': '\n SW2020\xa0零組件繪圖操作流程影片 (Youtube)\xa0 \n', 'tags': '', 'url': 'SOLIDWORKS 操作流程.html'}, {'title': 'ONSHAPE\xa0繪圖', 'text': 'ONSHAPE  緣起說明與介紹 \n Solidworks創辦人於2012年創建Onshape產品，並於2019年10月23日由PTC以4.7億美元收購，這是PTC第一個SaaS產品，也是全球第一個全雲端的3D整合型軟體，更為分散式團隊提供適合的3D CAD系統軟體。   Onshape CEO John McEleney表示，台灣擁有龐大的工業製造基礎，提供跨全球的產品與服務，而Onshape提供的繁體中文操作介面，讓使用者能更加快腳步為公司完成更好的成果。 \n \n \n \n \n \n', 'tags': '', 'url': 'ONSHAPE\xa0繪圖.html'}, {'title': 'ONSHAPE\xa0安裝配置', 'text': 'CAD2 套件下載安裝與配置影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  套件下載安裝與配置影片」且加上 語音說明 與 字幕. \n ONSHAPE\xa0套件下載安裝步驟 \n STEP1.前往ONSHAPE 網站 \n STEP2.註冊申請 \n STEP3.完成! \n 安裝影片連結 \n \n', 'tags': '', 'url': 'ONSHAPE\xa0安裝配置.html'}, {'title': 'ONSHAPE\xa0操作流程', 'text': '\xa0 \n ONSHAPE 零組件繪圖操作流程影片 (Youtube)\xa0 \n \n \n', 'tags': '', 'url': 'ONSHAPE\xa0操作流程.html'}, {'title': '運動場景', 'text': 'SW2021: \n SW2021: 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n \n Onshape: \n onshape\xa0零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱.', 'tags': '', 'url': '運動場景.html'}, {'title': 'W13', 'text': '請建立一個 Wink 檔案說明截至目前所完成的兩套 CAD 零組件繪圖進度 (30%). \n \n \n \n \n \n   \n \n \n 請建立一個 Wink 檔案, 將 1. 已經完成的 meArm 機械手臂第一軸, 加入 https://www.coppeliarobotics.com/helpFiles/en/simUI-widgets.htm slider, 可以在執行時, 利用滑鼠拖動旋轉 360 度 (30%). \n \n \n \n \n \n \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'W11', 'text': '零件尺寸圖: 連結 \n 四連桿零件下載(SW): 下載連結 \n 四連桿零件下載(ONS): 下載連結 \n 四連桿繪圖過程 (Youtube) \n', 'tags': '', 'url': 'W11.html'}, {'title': 'HW2', 'text': 'HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 請將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 請利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 並結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n 參考: \n 2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf \n Robot Manipulator Control with Inverse Kinematics PD-Pseudoinverse Jacobian and Forward Kinematics Denavit Hartenber.pdf \n KINEMATIC ANALYSIS FOR ROBOT ARM.pdf \n https://codebender.cc/user/MeArm \n https://github.com/mdecourse/meArmPi \n /downloads/MeArmPiTechnicalOverviewV0-3DRAFT.pdf \n https://github.com/mdecourse/me-arm-ik \n https://github.com/mdecourse/mearm_model \n https://courses.ece.cornell.edu/ece5990/ECE5725_Fall2016_Projects/pas324_ml634/index.html \n https://github.com/mdecourse/InefficientSkittleSorter \n https://mearm.com \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 請從上列 Tasks 中自行選擇項目內容完成 HW3. \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': '2022.01.06 2b 課堂考試 \n 1.請確認點名網頁中的學號與 Github 帳號對應資料, 學期成績評分將依據此一連結. 若有更動請透過 studlist 中的 Pull Requests 提出更改.  \n 2.期末 Final Project 頁面 (包含本週與下週的考試內容), 必須以學號為標題, 在個人的作業動態網站上製作完成 H3 頁面內容後, 將超文件存為"學號_html.txt", 並以 Pull Requests 送至期末倉儲 downloads 目錄後, 由各組組長合併至 cad2021_final, 後續學員內容導入與靜態網頁轉換將透過程式統一處理, 各組組長只要負責將學員的期末報告網頁合併至 downloads 即可.  \n 3.本週考試題目共有兩題, 第一題如先前公布, 請學員自選 CAD 套件, 完成零組件繪圖後, 轉入 CoppeliaSim, 以 Slider 0-360 度控制藍色搖桿轉動.  \n 4.本週考試第二題為延伸第一個題目, 以相同尺寸完成對稱之連桿機構, 從 CAD 套件轉入 CoppeliaSim 後, 以 Slider 0-360 度控制 Point0-Point1 搖桿轉動.  \n 5.請各學員分別以圖片及影片檔案, 呈現零件繪圖, 轉檔, 以及模擬場景製作的關鍵畫面, 並在送至期末倉儲 downloads 頁面中加上製作心得後, 請組長將各學員的期末頁面合併至 cad2021_final 倉儲中.  \n 6.完成上述步驟後, 請將相關連結在本討論區回報, 並提供本學期的課程學習心得. \n', 'tags': '', 'url': 'Final Project.html'}, {'title': '題目一', 'text': '\n SOLIDWORS零件檔案: 下載連結 \n STL檔: 下載連結 \n SOLIDWORS繪圖與組裝過程影片 :(零件組裝完成後轉stl檔放入coppeliasim) \n \n COPPELIASIM機構運動過程: \n \n \n COPPELIASIM機構運動過程:(WINK) \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n 心得:這學期學到了新的繪圖軟體、錄影程式及運動模擬，如onshape、wink及coppeliasim，一開始學的很吃力，但經過一學期後有開始熟悉軟體的操作方式。 \n', 'tags': '', 'url': '題目一.html'}, {'title': '題目二', 'text': '題目二零件下載: 連結 \n 題目二STL檔下載: 連結 \n SOLIDWORS繪圖與組裝過程影片 :(零件組裝完成後轉stl檔放入coppeliasim) \n \n COPPELIASIM機構運動過程:(WINK) \n \n \n \n \n \n   \n \n \n \n \n \n \n \n', 'tags': '', 'url': '題目二.html'}, {'title': '期末考試', 'text': '第一階段: meArm Robot 零件與組立檔案下載連結: \n https://drive.google.com/file/d/1TGW8IfmLc028KS_4ZKitZMdP5zABuzI-/view?usp=sharing \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n 第二階段: 修改第一階段個人所完成的 meArm 組立檔案, 將兩側連桿機構互換, 亦即將帶有三角形連桿的機構與另一方機構互相對調.\xa0 \n 零件與組立檔案下載連結: \n https://drive.google.com/file/d/1GQRilb1S26_GUgMpi97wQGY41qjF254G/view?usp=sharing \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '期末考試.html'}]};